package com.example.admin.myapplicationtest.models;import io.objectbox.annotation.Entity;import io.objectbox.annotation.Id;import io.objectbox.annotation.Unique;@Entitypublic class Customer {    @Id      public   long    id;             private  String  name;    @Unique  private  String  email;    public Customer(long id, String name, String email) {        this.id = id;        this.name = name;        this.email = email;    }    public Customer() {    }    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }}